import React from 'react';
import classes from './MenuStructure.module.css';
const MenuStructure =(props)=>{
    return(
        <div className = {classes.MenuStructure}>
            <ul>
                <li><a href="#">Dashboards</a></li>
                <li><span className = "mdi mdi-comment-account-outline"></span> <a href="#">Даатгал</a></li>
            </ul>
        </div>
    );
}
export default MenuStructure;
